import React, { useState } from "react";
import { Link } from "react-router-dom";
import HomebtImg from "../../assets/homebotton.png";
import "./Check.css";

const Check = ({ pizza }) => {
  const [setCount] = useState(1);

  return (
    <div className="Check">
      <div className="Check_main">
        <div className="TopCheck">
          <h1 className="titlechecks"> Adicionar Outra Pizza </h1>
          <Link className="return" to="/">
            <img src={HomebtImg} className="" alt="logo" />
          </Link>
        </div>
      </div>

      <div className="check_main">
        <div className="onepizzabox">
          <img src="" alt="icon" />

          <p>Banana ,Açúcar ,Muçarela, Banana , Açúcar ,Muçarela</p>

          <input type="checkbox" />
        </div>
      </div>

      <div className="check_Reorder">
        <Link className="Checkvalid" to="/confirmation">
          <h1>ADICIONAR OUTRA PIZZA</h1>
        </Link>
        <Link className="Checkvalid" to="/confirmation">
          <h1>FINALIZAR PEDIDO</h1>
        </Link>
      </div>

      <div className="check_footer">
        <h1 className="TotalPrice">VALOR TOTAL : 24 $R</h1>

        <h1 className="TotalPizza">PIZZA : 1</h1>
      </div>
    </div>
  );
};

export default Check;
